import React from 'react';
import { Link } from 'react-router-dom';
import axios from "axios";

const HomePage = () => {
    const handleLogout = async () => {
        try {
            await axios.post('http://localhost:5163/Account/logout');
            console.log('Logged out successfully');
            // Handle any UI changes after successful logout
        } catch (error) {
            console.error('Error logging out:', error);
            // Handle any errors or display error messages
        }
    };

    const handleAdminOnly = async () => {
        try {
            await axios.get('http://localhost:5163/Admin/admin-only');
            console.log('Admin endpoint accessed');
            // Handle any UI changes or actions specific to admin-only functionality
        } catch (error) {
            console.error('Error accessing admin endpoint:', error);
            // Handle any errors or display error messages
        }
    };

    const handleArtistOnly = async () => {
        try {
            await axios.get('http://localhost:5163/Artist/artist-only');
            console.log('Artist endpoint accessed');
            // Handle any UI changes or actions specific to artist-only functionality
        } catch (error) {
            console.error('Error accessing artist endpoint:', error);
            // Handle any errors or display error messages
        }
    };

    const handleUserOnly = async () => {
        try {
            await axios.get('http://localhost:5163/User/user-only');
            console.log('User endpoint accessed');
            // Handle any UI changes or actions specific to user-only functionality
        } catch (error) {
            console.error('Error accessing user endpoint:', error);
            // Handle any errors or display error messages
        }
    };
    return (
        <div>
            <h2>Welcome to our Application</h2>
            <div>
                <Link to="/register">
                    <button>Register</button>
                </Link>
            </div>
            <div>
                <Link to="/login">
                    <button>Login</button>
                </Link>
            </div>
            <h2>Welcome to our Application</h2>
            <div>
                <button onClick={handleLogout}>Logout</button>
            </div>
            <div>
                <button onClick={handleAdminOnly}>Admin Only</button>
            </div>
            <div>
                <button onClick={handleArtistOnly}>Artist Only</button>
            </div>
            <div>
                <button onClick={handleUserOnly}>User Only</button>
            </div>
        </div>
    );
};

export default HomePage;
